import './App.css';
import history from './history';
import Button from "./Components/Buttons";
import React from "react";
import Wrapper from "./Components/Wrapper";

function App()  {
    return (
        <Wrapper>
        <div className="Home" style={{position: 'relative', left: 10}}>
            <div className="lander">
                <h1>Welcome</h1>
                <form>
                    <Button type ="button"
                            buttonStyle="btn--solid--solid"
                            buttonSize="btn-small" onClick={() => history.push("/login")}>Login</Button>
                    &nbsp;&nbsp;&nbsp;
                    <Button type ="button"
                        buttonStyle="btn--danger--solid"
                        buttonSize="btn-small" onClick={() =>  history.push("/signup")}>Sign Up</Button>
                </form>
            </div>
        </div>
        </Wrapper>
    );
}

export default App;
